[{"sha":"a9e1d40a258ea26ba251b83d66a950b6497a227b","author":{"name":"Jacques Pienaar","email":"8b5f536c3e2f2b8ae266b27bc9085a584b5bd904@google.com"},"message":"Add effect for GeneratorOp

Ensure GeneratorOp's retain the same original global ordering before and after island breakup by creating a new memory effect.

- Create a new TF_GeneratorOpSideEffect to capture the ordering (this also has the benefit of restricting optimizations on the op as required while be less restrictive);
- The tracking of such non-value resources should be generalized, but starting with one and we can generalize when the structure required is clearer;
- Add some additional logging at v=1 to make it easier to track the logic;
- IdentityOp is now marked as side-effect free so updated;

